import React from 'react';
import { Field, reduxForm } from 'redux-form';

class ContactForm extends React.Component {

  onSubmit= (formValues) => {
    console.log(formValues);
  }

  render() {
    return (
      <div>Form</div>
    )
  }
}

export default reduxForm({
  form: 'contactForm'
})(ContactForm);
